import React from 'react';
import { BrowserRouter as Router, RoutesRoute, Switch } from 'react-router-dom';
import Navbar from './components/Navbar';
import Register from './components/Register';
import Login from './components/Login';
import ChildList from './components/ChildList';
import AddChild from './components/AddChild';
import CaregiverList from './components/CaregiverList';

function App() {
  return (
    <Router>
      <div>
        <Navbar />
        <div className="container">
          <Switch>
            <Route path="/register" component={Register} />
            <Route path="/login" component={Login} />
            <Route path="/children" component={ChildList} />
            <Route path="/add-child" component={AddChild} />
            <Route path="/caregivers" component={CaregiverList} />
            <Route path="/" exact component={Register} /> {/* Default to register */}
          </Switch>
        </div>
      </div>
    </Router>
  );
}

export default App;
